import React, { useState } from 'react';

const App = () =>{
    const [values, setValues] = useState();
    const inputEvents =(event) =>{
        setValues(event.target.value)
    }
    return(
        <div>
            <h1>{values}</h1>
            <input type="text" onChange={inputEvents}/>
            <div>
            <button onClick={inputEvents} value ="1">1</button>
            <button>2</button>
            <button>3</button>
            <button>4</button>
            <button>5</button>
            <button>6</button>
            <button>7</button>
            <button>8</button>
            <button>9</button>
            <button>0</button>
            </div>
        </div>
    );
}

export default App;
